import React, { Component, Fragment } from "react";

export default class AppFooter extends Component {
  render() {
    const currentYear = new Date().getFullYear();

    return (
      <Fragment>
        <hr />
        <p>Copyright &copy; {currentYear} Acme Ltd.</p>
      </Fragment>
    );
  }
}
